import React from "react"

const HelloContainer = ({children}) => (
    <div className="hello-container">{children}</div>
);

export class HelloWorld extends React.Component {
    render() {
        return (
            <HelloContainer>{this.props.name}</HelloContainer>
        )
    }
}
